import React, { useState } from 'react';
import { GoogleLogin } from 'react-google-login'; // Corrected import statement
import './register.css';
import bcrypt from 'bcryptjs';

function App() {
  const [formData, setFormData] = useState({
    nombres: '',
    apellidos: '',
    celular: '',
    email: '',
    direccion: '',
    contrasena: '',
  });
  const [errors, setErrors] = useState({});
  const [errorMessage, setErrorMessage] = useState('');
  const [successMessage, setSuccessMessage] = useState('');

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
    setErrors({
      ...errors,
      [name]: '',
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    const newErrors = {};
    Object.keys(formData).forEach((key) => {
      if (!formData[key]) {
        newErrors[key] = `El campo ${key} es requerido`;
      }
    });

    if (!/(?=.*[A-Z])(?=.*[a-z].*[a-z].*[a-z].*[a-z].*[a-z])(?=.*[0-9])/.test(formData.contrasena)) {
      newErrors.contrasena = 'La contraseña debe tener al menos una mayúscula, cinco minúsculas y un número';
    }

    if (Object.keys(newErrors).length > 0) {
      setErrors(newErrors);
    } else {
      const hashedPassword = bcrypt.hashSync(formData.contrasena, 10);

      fetch('http://127.0.0.1:8000/api/app1/Usuarios/', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ email: formData.email }),
      })
        .then((response) => {
          if (response.ok) {
            return response.json();
          } else {
            throw new Error('El usuario o correo electrónico ya existe');
          }
        })
        .then(() => {
          fetch('http://127.0.0.1:8000/api/app1/Usuarios/', {
            method: 'POST',
            headers: {
              'Content-Type': 'application/json',
            },
            body: JSON.stringify({ ...formData, contrasena: hashedPassword }),
          })
            .then((response) => {
              if (response.ok) {
                setSuccessMessage('Usuario registrado exitosamente');
                setFormData({
                  nombres: '',
                  apellidos: '',
                  celular: '',
                  email: '',
                  direccion: '',
                  contrasena: '',
                });
              } else {
                throw new Error('Error al registrar usuario');
              }
            })
            .catch((error) => {
              setErrorMessage(error.message);
            });
        })
        .catch((error) => {
          setErrorMessage(error.message);
        });
    }
  };

  const handleGoogleRegister = (credentialResponse) => {
    // Handle Google registration here
    console.log(credentialResponse);
  };

  return (
    <div className='contenedor'>
      <div className="App">
        <h1>Registro de Usuarios</h1>
        {errorMessage && <p className="error">{errorMessage}</p>}
        {successMessage && <p className="success">{successMessage}</p>}
        <form onSubmit={handleSubmit}>
          <div>
            <label>Nombres:</label>
            <input type="text" name="nombres" value={formData.nombres} onChange={handleChange} /><br />
            {errors.nombres && <span className="error">{errors.nombres}</span>}
          </div>
          <GoogleLogin
            clientId="YOUR_GOOGLE_CLIENT_ID"
            buttonText="Registrarse con Google"
            onSuccess={handleGoogleRegister}
            onFailure={() => console.log('Login Failed')}
            cookiePolicy={'single_host_origin'}
          />
          <div>
            <label>Apellidos:</label>
            <input type="text" name="apellidos" value={formData.apellidos} onChange={handleChange} /><br />
            {errors.apellidos && <span className="error">{errors.apellidos}</span>}
          </div>
          {/* Other input fields */}
          <button type="submit">Registrarse</button>
        </form>
      </div>
    </div>
  );
}

export default App;
